import React, {Component} from 'react'
import FeedItem from './feedItem'

class unregisteredFeed extends Component{

state = {
    unidentified: []
}

style = {
    overflow: 'scroll',
    height: '350px'
}

render(){

    // get 

    setInterval(()=>{
        let newList = this.state.unidentified.map((e, i)=>{
            return <FeedItem key="i" plateNumber="123456" time="3:30pm">456789</FeedItem>
        })
        newList.push(<FeedItem
        plateNumber="123456" time="3:30pm"></FeedItem>)
        this.setState({unidentified: newList})
    }, 5000)

    return(
    <div style={this.style}>
        <h1 style={{marginLeft: '25px'}}>Unregistered Activity</h1>
        {this.state.unidentified}
    </div>)}
}


export default unregisteredFeed
